import React , {useState , useEffect} from 'react'
import {useParams} from 'react-router-dom'
import {Box} from '@mui/material'
import { fetchData , exGetOptions } from '../utils/fetchData'
import Detail from '../components/Detail'
import ExerciseVideos from '../components/ExerciseVideos'
import SimilarExercises from '../components/SimilarExercises'

const ExerciseDetails = () => {
    const [exerciseDetail , setExerciseDetail] = useState({})
    const { id } = useParams()

    useEffect(()=> {
        const fetchChooseExercise = async ()=> {
            const exerciseDetail = await fetchData(`https://exercisedb.p.rapidapi.com/exercises/${id}` , exGetOptions) 
            setExerciseDetail(exerciseDetail)
            console.log()
        }
        fetchChooseExercise()
    } ,
    [id])
    return (
        <Box>
            <Detail />
            <ExerciseVideos />
            <SimilarExercises />
        </Box>
    )
}

export default ExerciseDetails
